import React, { ReactNode } from 'react';
import Head from 'next/head';

type Props = {
  children?: ReactNode;
  title?: string;
};

const WizardLayout: React.FC<Props> = ({ children, title }) => {
  return (
    <React.Fragment>
      <Head>
        <title>{title}</title>
        <meta charSet="utf-8" />
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>
      <div className="container payment-container">
        <div className="row">
          <div className="col-sm-1 my-auto">
            <img src="/img/araka/logo_transparent_background.png" alt="logo" />
          </div>
          <div className="col-sm-10 my-auto">
            <div className="payment-steps">{children}</div>
          </div>
          <div className="col-sm-1 my-auto">
            <i className="fa fa-times"></i>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
};

export { WizardLayout };
